import React, { Component } from 'react'

class NameList extends Component {
  render() {
    let persons = [
      {
        id: 1,
        name: "Adil",
        age: 17,
      },
      {
        id: 2,
        name: "Nurik",
        age: 18,
      },
      {
        id: 3,
        name: "Danil",
        age: 18,
      },
    ]
    let listName = persons.map((person) => <h1 key={person.id}>{person}</h1>)
    return {listName}
  }
}

export default NameList;
